import React, { Component } from "react";
import { Link } from "react-router-dom";
import BuyCar from "./BuyCar";

import {
  ACCESS_LEVEL_GUEST,
  ACCESS_LEVEL_ADMIN,
  SERVER_HOST,
} from "../config/global_constants";

class CarTableRow extends Component {
  render() {
    let soldOrForSale = null;
    if (localStorage.accessLevel <= ACCESS_LEVEL_GUEST) {
      if (this.props.car.sold !== true) {
        soldOrForSale = (
          <BuyCar carID={this.props.car._id} price={this.props.car.price} />
        );
      } else {
        soldOrForSale = "SOLD";
      }
    }

    return (
      <Link to={`/carDetails/${this.props.car._id}`} className="itemsBox">
        <div className="carPhotos">
          {this.props.car.photos.map((photo) => (
            <img key={photo._id} id={photo._id} src={`${SERVER_HOST}/cars/photo/${photo.filename}`} alt="" />
          ))}
        </div>
        <div className="details">
          <h3>{this.props.car.name}</h3>
          <i>â‚¬{this.props.car.price}</i>
        </div>
        <p>
          {localStorage.accessLevel > ACCESS_LEVEL_GUEST ? (
            <Link
              className="green-button"
              to={`/EditCar/${this.props.car._id}`}
            >
              Edit
            </Link>
          ) : null}

          {localStorage.accessLevel >= ACCESS_LEVEL_ADMIN ? (
            <Link
              className="red-button"
              to={`/DeleteCar/${this.props.car._id}`}
            >
              Delete
            </Link>
          ) : null}

          {soldOrForSale}
        </p>
      </Link>
    );
  }
}

export default CarTableRow;
